import React from "react";

const StudyCard = () => {
  return (
    <div className="studyCard">
      <img className="study-thumbnail" src=""></img>
      <h3>스터디 이름</h3>
      <h5>스터디 한 줄 설명</h5>
      <div>지역 | 0/4</div>
    </div>
  );
};

export default StudyCard;
